import React from "react";

const Connect = () => {
  return (
    <div>
      <div
        style={{
          width: "59px",
          height: "59",
          overflow: "hidden",
          margin: "0 auto",
          outline: "none",
        }}
        title
        role="button"
        aria-label="animation"
        tabIndex={0}
      >
        <svg
          xmlns="http://www.w3.org/2000/svg"
          viewBox="0 0 50 50"
          width={50}
          height={50}
          preserveAspectRatio="xMidYMid meet"
          style={{
            width: "100%",
            height: "100%",
            transform: "translate3d(0px, 0px, 0px)",
          }}
