              transform="matrix(1,0,0,1,22.966773986816406,-11.483386993408203)"
              opacity={1}
              style={{ display: "block" }}
            >
              <g opacity={1} transform="matrix(1,0,0,1,9,25)">
                <path
                  strokeLinecap="butt"
                  strokeLinejoin="miter"
                  fillOpacity={0}
