                  strokeWidth={2}
                  d=" M0,-6 C-3.312999963760376,-6 -6,-3.312999963760376 -6,0 C-6,3.312999963760376 -3.312999963760376,6 0,6 C3.312999963760376,6 6,3.312999963760376 6,0 C6,-3.312999963760376 3.312999963760376,-6 0,-6z"
                />
              </g>
            </g>
            <g
              transform="matrix(1,0,0,1,32.641143798828125,27.612539291381836)"
