                strokeMiterlimit={4}
                stroke="rgb(255,169,89)"
                strokeOpacity={1}
                strokeWidth={2}
                d=" M-4.620922565460205,-2.5728113651275635 C-4.620922565460205,-2.5728113651275635 3.4417083263397217,2.2909491062164307 3.4417083263397217,2.2909491062164307"
