                strokeOpacity={1}
                strokeWidth={2}
                d=" M3.402120351791382,-1.6677767038345337 C3.402120351791382,-1.6677767038345337 -1.7414131164550781,-0.5587731599807739 -1.7414131164550781,-0.5587731599807739"
